(table/table-view 
  (map 
    (fn [[k v]] 
      (concat [(element-name k)] (format-to-table-view v))) 
    (zipmap (vals broadcasters) (map #(delays % t0 tmax :statistics) (keys broadcasters)))) 
  :columns table-columns)
