;; @@
#_(for [b broadcasters]
  (plot-td-dist b))
;; @@

;; **
;;; ## Evolution
;; **

;; @@
(defn plot-td-evolution [[id author]]
(let [curr (map :mean (delays id t0 tmax :evolution))
       dat {:count curr
            :days (range (count curr))}]
    (gg4clj/view
      [[:<- :d (gg4clj/data-frame dat)]
       (gg4clj/r+
         [:ggplot :d [:aes :days :count]]
         [:geom_line {:color "#999999"}]
         [:xlab "Day"]
         [:ylab "Hours"]
         [:theme_bw]
         [:ggtitle (str "Average temporal distance evolution of " (element-name author))])]
      {:width 5 :height 5})))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;mellow-pond/plot-td-evolution</span>","value":"#'mellow-pond/plot-td-evolution"}
;; <=

;; @@
(let [curr (->>   broadcasters
                  (map (fn [[id author]] (map :mean (delays id t0 tmax :evolution))))
                  (apply map vector)
                  (map stats/mean)
                  )
       dat {:count curr
            :days (range (count curr))}]
    (gg4clj/view
      [[:<- :d (gg4clj/data-frame dat)]
       (gg4clj/r+
         [:ggplot :d [:aes :days :count]]
         [:geom_line {:color "#999999"}]
         [:xlab "Day"]
         [:ylab "Minutes"]
         [:theme_bw]
         [:ggtitle "Average temporal distance evolution"])]
      {:width 5 :height 5}))
